export const figureOutDate =(startDate,endDate)=>  {
    var date1 = new Date('12-09-2017');
    var date2 = new Date('12-10-2017');
return  Math.ceil(Math.abs(date1.getTime() - date2.getTime()) / (1000 * 3600 * 24));
};
